import React, { Component } from 'react'
import "../../Css/AllProjects.css";
import {  BrowserRouter as Router ,Switch, Route, Link} from "react-router-dom";

export default class AllProjects extends Component {
    render() {
        return (
             <div className="allProjects">
                <div className="navName">
                    <h4>All Projects</h4>
                    <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Quos, quaerat eaque. Harum sunt explicabo quam minima veniam possimus odit officiis?</p>
                    <div className="switchBtn">
                        <Link to="/asFreelancer" style={{textDecoration:0}}><button>As Freelancer</button></Link>
                         <Link to="/asClient" style={{textDecoration:0}}><button>As Client</button></Link>
                    </div>
                </div>
                <hr/>
                <div className="allProjects_body">
                    
                </div>
            </div>
        )
    }
}
